import { useState, useEffect } from 'react';
import { cloudStorageAPI } from '../services/api';

export const useGoogleAuth = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [accessToken, setAccessToken] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);

  // Check if user has stored tokens
  useEffect(() => {
    const storedToken = localStorage.getItem('google_access_token');
    const tokenExpiry = localStorage.getItem('google_token_expiry');
    
    console.log('üîç Checking stored tokens:', { 
      hasToken: !!storedToken, 
      hasExpiry: !!tokenExpiry,
      expiry: tokenExpiry ? new Date(parseInt(tokenExpiry)) : null
    });
    
    if (storedToken && tokenExpiry) {
      const now = new Date().getTime();
      if (now < parseInt(tokenExpiry)) {
        console.log('‚úÖ Using stored valid token');
        setAccessToken(storedToken);
        setIsAuthenticated(true);
      } else {
        console.log('‚è∞ Stored token expired, clearing...');
        localStorage.removeItem('google_access_token');
        localStorage.removeItem('google_token_expiry');
      }
    }
  }, []);

  const authenticate = async () => {
    console.log('üöÄ Starting Google authentication...');
    
    try {
      setIsLoading(true);
      setError(null);

      console.log('üìû Calling API to get auth URL...');
      const response = await cloudStorageAPI.getAuthUrl();
      const authUrl = response.data.authUrl;
      
      console.log('üîó Auth URL received:', authUrl);

      if (!authUrl) {
        throw new Error('No auth URL received from server');
      }

      // Create a promise to handle the popup result
      const authPromise = new Promise((resolve, reject) => {
        console.log('üîÑ Opening popup window...');
        
        const popup = window.open(
          authUrl,
          'google-auth',
          'width=600,height=700,scrollbars=yes,resizable=yes,left=' + 
          Math.round(window.screen.width / 2 - 300) + ',top=' + 
          Math.round(window.screen.height / 2 - 350)
        );

        if (!popup) {
          console.error('‚ùå Popup blocked!');
          reject(new Error('Popup blocked. Please allow popups for this site and try again.'));
          return;
        }

        console.log('‚úÖ Popup opened successfully');

        // Listen for messages from the popup
        const messageHandler = (event) => {
          console.log('üì® Message received in parent window:', {
            origin: event.origin,
            expectedOrigin: window.location.origin,
            data: event.data,
            type: event.data?.type
          });

          // Verify origin for security
          if (event.origin !== window.location.origin) {
            console.warn('‚ö†Ô∏è Message from unexpected origin:', event.origin);
            return;
          }

          if (event.data.type === 'GOOGLE_AUTH_SUCCESS') {
            console.log('‚úÖ Success message received:', {
              hasAccessToken: !!event.data.accessToken,
              tokenLength: event.data.accessToken?.length,
              expiry: event.data.expiry
            });
            window.removeEventListener('message', messageHandler);
            resolve({
              accessToken: event.data.accessToken,
              expiry: event.data.expiry
            });
          } else if (event.data.type === 'GOOGLE_AUTH_ERROR') {
            console.error('‚ùå Error message received:', event.data.error);
            window.removeEventListener('message', messageHandler);
            reject(new Error(event.data.error || 'Authentication failed'));
          }
        };

        window.addEventListener('message', messageHandler);
        console.log('üëÇ Message listener added');

        // Check if popup was closed manually
        const checkClosed = setInterval(() => {
          if (popup.closed) {
            console.log('‚ùå Popup was closed by user');
            clearInterval(checkClosed);
            window.removeEventListener('message', messageHandler);
            reject(new Error('Authentication cancelled by user'));
          }
        }, 1000);

        // Timeout after 5 minutes
        setTimeout(() => {
          console.log('‚è∞ Authentication timeout');
          clearInterval(checkClosed);
          window.removeEventListener('message', messageHandler);
          if (!popup.closed) {
            popup.close();
          }
          reject(new Error('Authentication timeout (5 minutes)'));
        }, 300000);
      });

      console.log('‚è≥ Waiting for authentication result...');
      
      // Wait for authentication result
      const { accessToken, expiry } = await authPromise;
      
      console.log('‚úÖ Authentication successful!', {
        tokenLength: accessToken?.length,
        expiry: new Date(parseInt(expiry))
      });
      
      // Store tokens
      localStorage.setItem('google_access_token', accessToken);
      localStorage.setItem('google_token_expiry', expiry.toString());
      
      setAccessToken(accessToken);
      setIsAuthenticated(true);

    } catch (error) {
      console.error('‚ùå Authentication failed:', error);
      setError(error.message || 'Authentication failed');
    } finally {
      setIsLoading(false);
    }
  };

  const logout = () => {
    console.log('üö™ Logging out...');
    localStorage.removeItem('google_access_token');
    localStorage.removeItem('google_token_expiry');
    setAccessToken(null);
    setIsAuthenticated(false);
    setError(null);
  };

  return {
    isAuthenticated,
    accessToken,
    isLoading,
    error,
    authenticate,
    logout
  };
};
